sys_variable_value.value:
var answers = data.get(28).output.answers;
var ip;
if(answers)
ip = answers[0].answer;

var reverseDomainName = ip.toString().split('.').reverse().join('.')+".in-addr.arpa";
var reverseZoneName = reverseDomainName.substring(reverseDomainName.indexOf(".") + 1);

workflow.scratchpad.reverseDomainName = reverseDomainName;
workflow.scratchpad.reverseZoneName = reverseZoneName;

